import { graphql, compose } from 'react-apollo';
import gql from 'graphql-tag';

import gqlTags from '../store/gql';

console.log({ gqlTags });

export const messagesGql = gql`
  query {
    messages {
      id
      text
      user
    }
    User {
      id
      firstName
      lastName
      avatar
    }
    usersTyping {
      id
      firstName
    }
    users {
      id
      avatar
      firstName
      lastName
    }
  }
`;

export const createMessageGql = gql`
  mutation createMessage($userId: ID! $text: String!) {
    createMessage(
      userId: $userId,
      text: $text
    ) {
      id
      text
    }
  }
`;

export const toggleUserTypingGql = gql`
  mutation toggleUserTyping($id: ID!, $isTyping: Boolean!) {
    toggleUserTyping(id: $id, isTyping: $isTyping)
  }
`;

export const newMessageSubscriptionGql = gql`
  subscription messageCreated {
    messageCreated {
      id
      text
      user {
        id
        avatar
      }
    }
  }
`;

export const userTypingSubscriptionGql = gql`
  subscription userIsTyping {
    userIsTyping {
      id
      firstName
      isTyping
    }
  }
`;


const withMessages = graphql(messagesGql, {
  name: 'messages',
  options: () => ({
    skip: true
  }),
  props: ({ messages: { error, loading, messages, users, User, usersTyping, fetchMore, subscribeToMore } }) => {
    if (error) return null;

    return {
      loading,
      messages,
      users,
      User,
      usersTyping,
      refetchMessages: (id) => fetchMore({
        variables: { id },
        updateQuery: (previousResult, { fetchMoreResult }) => {
          if (!fetchMoreResult) {
            return previousResult;
          }
          return Object.assign({}, previousResult, {
            messages: fetchMoreResult.messages
          });
        }
      }),
      subscribeToNewMessages: () => subscribeToMore({
        document: newMessageSubscriptionGql,
        // variables: { chatId: Chat && Chat.id },
        updateQuery: (prev, { subscriptionData }) => {
          if (!subscriptionData.data) return prev;
          return Object.assign({}, prev, {
            messages: [ ...prev.messages, subscriptionData.data.messageCreated ]
          });
        }
      }),
      subscribeToUserTyping: () => subscribeToMore({
        document: userTypingSubscriptionGql,
        // variables: { chatId: Chat && Chat.id },
        updateQuery: (prev, { subscriptionData }) => {
          if (!subscriptionData.data) return prev;

          if (subscriptionData.data.userIsTyping.isTyping) {
            // add to list
            if (!prev.usersTyping.find(i => i.id === subscriptionData.data.userIsTyping.id)) {
              return Object.assign({}, prev, {
                usersTyping: [ ...prev.usersTyping, subscriptionData.data.userIsTyping ]
              });
            }
          } else {
            // remove
            return Object.assign({}, prev, {
              usersTyping: prev.usersTyping.filter(i => i.id !== subscriptionData.data.userIsTyping.id)
            });
          }
        }
      })
    }
  }
})

const withCreateMessage = graphql(createMessageGql, {
  name: "createMessage",
  props: ({ createMessage }) => ({
    createMessageMutation: variables => createMessage({ variables })
  })
});

const withToggleTyping = graphql(toggleUserTypingGql, {
  name: 'toggleTyping',
  props: ({ toggleTyping }) => ({
    toggleUserTypingMutation: variables => toggleTyping({ variables });
  })
})


export default comp => compose(
  withMessages,
  withCreateMessage,
  withToggleTyping
)(comp);
